

/*Table structure for table `tbl_county_information` */

DROP TABLE IF EXISTS `tbl_county_information`;

CREATE TABLE `tbl_county_information` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `zip` varchar(10) DEFAULT NULL,
  `county` varchar(50) DEFAULT NULL,
  `city` varchar(50) DEFAULT NULL,
  `mayor` varchar(200) DEFAULT NULL,
  `total_population` varchar(10) DEFAULT NULL,
  `male_population` varchar(10) DEFAULT NULL,
  `female_population` varchar(10) DEFAULT NULL,
  `democratic_voters` varchar(10) DEFAULT NULL,
  `rupblic_voters` varchar(10) DEFAULT NULL,
  `independent_voters` varchar(10) DEFAULT NULL,
  `avg_age` varchar(10) DEFAULT NULL,
  `total_school` varchar(10) DEFAULT NULL,
  `school_rating` varchar(10) DEFAULT NULL,
  `city_manager` varchar(100) DEFAULT NULL,
  `city_clerk` varchar(100) DEFAULT NULL,
  `finance_director` varchar(100) DEFAULT NULL,
  `public_work_director` varchar(100) DEFAULT NULL,
  `police_chief` varchar(100) DEFAULT NULL,
  `fire_chief` varchar(100) DEFAULT NULL,
  `park_recretion_director` varchar(100) DEFAULT NULL,
  `planning_director` varchar(100) DEFAULT NULL,
  `economic_director` varchar(100) DEFAULT NULL,
  `human_resource_director` varchar(100) DEFAULT NULL,
  `it_director` varchar(100) DEFAULT NULL,
  `utility_director` varchar(100) DEFAULT NULL,
  `housing_director` varchar(100) DEFAULT NULL,
  `environment_director` varchar(100) DEFAULT NULL,
  `city_attorney` varchar(100) DEFAULT NULL,
  `upcoming_elections` text,
  `user_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8;

/*Data for the table `tbl_county_information` */


/*Table structure for table `tbl_quotes` */

DROP TABLE IF EXISTS `tbl_quotes`;

CREATE TABLE `tbl_quotes` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `author` varchar(100) DEFAULT NULL,
  `quotes` varchar(500) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8;

/*Data for the table `tbl_quotes` */


/*Table structure for table `tbl_user` */

DROP TABLE IF EXISTS `tbl_user`;

CREATE TABLE `tbl_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL,
  `email` varchar(100) NOT NULL,
  `password` varchar(500) NOT NULL,
  `role` int(11) NOT NULL,
  `plain_pass` varchar(200) NOT NULL,
  `phone` varchar(20) NOT NULL,
  `profilePic` varchar(200) DEFAULT NULL,
  `status` enum('A','I') DEFAULT 'A',
  `terms_accepted` varchar(5) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

/*Data for the table `tbl_user` */


