insert into `tbl_quotes` (`id`,`author`,`quotes`) values (2,'John Lewis','\"The vote is the most powerful nonviolent tool we have.\"');
insert into `tbl_quotes` (`id`,`author`,`quotes`) values (3,'Rosa Parks','\"One person, one vote. I couldn');
insert into `tbl_quotes` (`id`,`author`,`quotes`) values (4,'Martin Luther King Jr.','\"Voting is the foundation stone for political action.\"');
insert into `tbl_quotes` (`id`,`author`,`quotes`) values (5,'Angela Davis','\"The struggle for the right to vote is a struggle for democracy.\"');
insert into `tbl_quotes` (`id`,`author`,`quotes`) values (6,'Susan B. Anthony','\"Someone struggled for your right to vote. Use it.\"');
insert into `tbl_quotes` (`id`,`author`,`quotes`) values (7,'Elizabeth Cady Stanton','\"The right to vote is ours and it must not be denied.\"');
insert into `tbl_quotes` (`id`,`author`,`quotes`) values (8,'Sojourner Truth','\"Voting is not a privilege, it is a right.\"');
insert into `tbl_quotes` (`id`,`author`,`quotes`) values (9,'Franklin D. Roosevelt','\"Nobody will ever deprive the American people of the right to vote.\"');
insert into `tbl_quotes` (`id`,`author`,`quotes`) values (10,'Abraham Lincoln','\"The ballot is stronger than the bullet.\"');
insert into `tbl_quotes` (`id`,`author`,`quotes`) values (11,'Lyndon B. Johnson','\"A man without a vote is a man without protection.\"');
insert into `tbl_quotes` (`id`,`author`,`quotes`) values (12,'Larry J. Sabato','\"Every election is determined by the people who show up.\"');
insert into `tbl_quotes` (`id`,`author`,`quotes`) values (13,'Benjamin Todd Jealous','\"The right to vote is the right upon which all of our rights are leveraged.\"');
