insert into `tbl_quotes` (`id`,`author`,`quotes`) values (15,'Horace Mann','\"Voting is a civic sacrament.\"');
insert into `tbl_quotes` (`id`,`author`,`quotes`) values (16,'Booker T. Washington','\"Voting is an essential part of democracy.\"');
